function Progress({ totalPoints, numberOfQuestions, index }) {
  return (
    <header className="progress">
      <p>
        Question <strong> 0/{numberOfQuestions}</strong>
      </p>

      <p>
        Question <strong> 0/{totalPoints}</strong>
      </p>
    </header>
  );
}

export default Progress;
